// src/components/UserProfile.js
import React from 'react';
import ProgressDashboard from '../components/ProgressDashboard'; // Import ProgressDashboard
import profileImage from '../assets/pictures/huohuo.jpg'; // Import your profile image
import './css/UserProfile.css';
import { Link } from 'react-router-dom';
const UserProfile = () => {
  // Sample user data
  const user = {
    name: 'John Doe',
    email: 'john.doe@example.com',
    progress: '80%', // Example progress percentage
  };

  return (
    <div className="user-profile">
      <nav>
            <ul>
              <li><Link to="/" className="active">Home</Link></li>
              <li><Link to="/study">Exercises</Link></li>
              <li><Link to="/about">About</Link></li>
              <li className="dropdown">
                <a href="#" className="dropbtn">See More</a>
                <div className="dropdown-content">
                  <Link to="/user-profile">Profile</Link>
                  <Link to="/contact">Contact</Link>
                  <a href="#" onClick={handleLogout}>Logout</a>
                </div>
              </li>
            </ul>
          </nav>

      <h1>User Profile</h1>
      <div className="profile-info">
        <img src={profileImage} alt="Profile" className="profile-image" /> {/* Profile Image */}
        <h2>{user.name}</h2>
        <p>Email: {user.email}</p>
        <p>Learning Progress: {user.progress}</p>
      </div>

      {/* Include ProgressDashboard */}
      <ProgressDashboard />
    </div>
  );
};

export default UserProfile;
